import {AuthModule} from "./auth/auth.module";
import {TipoCambioModule} from "./tipo-cambio/tipo-cambio.module";

@NgModule({
  declarations: [
    AppComponent
  ],
  imports: [
    BrowserModule,
    BrowserAnimationsModule,
    AuthModule,
    TipoCambioModule,

  ],
